import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Container } from 'react-bootstrap';

function Home() {
  return (
    <Container className="text-center mt-5">
      <h1>Início</h1>
      <div className="mt-4">
        <Link to="/converter">
          <Button variant="primary" className="me-2">Converter Moeda</Button>
        </Link>
        <Link to="/historico">
          <Button variant="secondary">Ver Histórico</Button>
        </Link>
      </div>
    </Container>
  );
}

export default Home;
